import React from "react";
import "./Sidebar.css";

const Sidebar = ({ history, setActiveItem }) => {
  return (
    <div className="sidebar">
      <h2>History</h2>
      <ul>
        {history.length === 0 ? (
          <p>No history yet</p>
        ) : (
          history.map((item, index) => (
            <li key={index} onClick={() => setActiveItem(item)}>
              {item}
            </li>
          ))
        )}
      </ul>
    </div>
  );
};

export default Sidebar;
